def extract_years(text):
  '''Находит все четырехзначные числа внутри исходного текста и возвращает их в виде списка чисел класса int с сохранением последовательности'''
  digits_only = []
  years = []
  for ch in text:
    if ch.isdigit():
      digits_only.append(ch)
    else:
      digits_only.append(" ")
  for word in ''.join(digits_only).split():
    if word.isdigit() and len(word) == 4:
      years.append(word)
  return years
